const initialState = {
    contacts:''
}

const fetchContactReducer =(state=initialState, action)=>{
    switch(action.type){
        case 'FETCH_CONTACTS':{
            return {...state, contacts:action.contacts };
        }
        default:
        return state;

    }
}


export default fetchContactReducer;
